--TABLES
SET default_tablespace = ts_licpub_data;
SET default_with_oids = false;

--Se crea tabla cucop
CREATE TABLE if not exists licpub.cucop
(
    id_cucop integer NOT NULL,
    id_capitulo integer NOT NULL,
    id_concepto integer NULL,
    id_partida_generica integer NULL,
    id_partida_especifica integer NULL,
    descripcion character varying(1000) NOT NULL
)TABLESPACE ts_licpub_data;

ALTER TABLE licpub.cucop OWNER TO licpub;

SET default_tablespace = ts_licpub_idx;

ALTER TABLE licpub.cucop ADD CONSTRAINT cucop_pkey PRIMARY KEY (id_cucop)
	USING INDEX TABLESPACE ts_licpub_idx;

ALTER TABLE ONLY licpub.cucop
    ADD CONSTRAINT cucop_fk FOREIGN KEY (id_capitulo)
    REFERENCES licpub.capitulo(id_capitulo) DEFERRABLE INITIALLY DEFERRED;

ALTER TABLE ONLY licpub.cucop
    ADD CONSTRAINT cucop_fk1 FOREIGN KEY (id_concepto)
    REFERENCES licpub.concepto(id_concepto) DEFERRABLE INITIALLY DEFERRED;

ALTER TABLE ONLY licpub.cucop
    ADD CONSTRAINT cucop_fk2 FOREIGN KEY (id_partida_generica)
    REFERENCES licpub.partida_generica(id_partida_generica) DEFERRABLE INITIALLY DEFERRED;

ALTER TABLE ONLY licpub.cucop
    ADD CONSTRAINT cucop_fk3 FOREIGN KEY (id_partida_especifica)
    REFERENCES licpub.partida_especifica(id_partida_especifica) DEFERRABLE INITIALLY DEFERRED;

